css:
@-moz-document domain(axosoft.com) {
	.yui3-overlay-modal {height:95%!important;}
	.yui3-overlay-modal .axo-popup-content,
	.ontime-pages-addEditWorkLog,
	.ontime-pages-addEditWorkLog .standard-form {height:100%;}

	.ontime-pages-addEditWorkLog {position:relative; padding:0 10px;}
	.ontime-pages-addEditWorkLog .standard-form {margin-top:10px;}
	.ontime-pages-addEditWorkLog .standard-form .fields {max-height:100%; margin-top:10px;}
	.ontime-pages-addEditWorkLog .standard-form .item-field-cell-full textarea {max-height:100%; height:320px!important; background:lightblue;}

	.ontime-pages-addEditWorkLog .progress {margin-top:50px;}
	.ontime-pages-addEditWorkLog .standard-form + .row {position:absolute; bottom:0; right:30px; width:300px;}
	.ontime-pages-addEditWorkLog .estimates-container .bar-info.workLogActualWork {width:150px!important}
	.ontime-pages-addEditWorkLog .estimates-container .bar-info.workLogRemainingEstimate {width:130px!important;}

	/* OnTime Loader */
	.yui3-cardgrid-loading:before,
	.yui3-cardgrid-loading:after {content:''; display:block; width:100%; height:100%; position:absolute; top:0;}

	/* Nyan Background */
	.yui3-cardgrid-loading:before {
		opacity:0.8;
		background-image:url('data:image/gif;base64,')!important;
		background-repeat:repeat;
	}

	/* Nyan Cat */
	.yui3-cardgrid-loading:after {
		background-image:url('data:image/gif;base64,');
		background-repeat:no-repeat;
		background-position:center center!important;
	}
	.yui3-cardgrid-loading span {display:none!important;}
	.yui3-cardgrid-loading-indicator {background:none!important;}
}
